import logo from  '../Images/logo-mimate.png'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import './'

const logoTamaño= {
    width: '7rem',
    height: '7rem'
}

const style = {
  margin: 0,
  padding: 0,
}

function NavBarLogo() {
    return (
      <>
      <Navbar bg="dark" variant="dark">
        <Container style={style}>
          <Navbar.Brand href="#home">
            <img
              alt=""
              src={logo} style={logoTamaño}
              width="30"
              height="30"
              className="d-inline-block align-center"
            />{' '}
            SyA Mi Mate
          </Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#Mates">Home</Nav.Link>
            <Nav.Link href="#Bombillas">Bombillas</Nav.Link>
            <Nav.Link href="#Yerbas">Yerbas</Nav.Link>
            <Nav.Link href="#Termos">Termos</Nav.Link>
            <Nav.Link href="#Accesorios">Accesorios</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </>
    );
  }
  
  export default NavBarLogo;
